//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Multisig {
    address[] public approvers;
    uint256 public quorum;
    struct Transfer {
        uint256 id;
        uint256 amount;
        address payable to;
        uint256 amountOfApprovers;
        bool sent;
    }
    mapping(uint256 => Transfer) transfers;
    uint256 nextId;
    mapping(address => mapping(uint256 => bool)) approvals;

    constructor(address[] memory _approvers, uint256 _quorum) payable {
        approvers = _approvers;
        quorum = _quorum;
    }

    modifier onlyApprovers() {
        bool allowed = false;
        for (uint256 i = 0; i < approvers.length; i++) {
            if (approvers[i] == msg.sender) {
                allowed = true;
            }
        }
        require(allowed == true, "Only approvers allowed");
        _;
    }

    function createTransfer(uint256 _amount, address payable _to)
        external
        onlyApprovers
    {
        transfers[nextId] = Transfer(nextId, _amount, _to, 0, false);
        nextId++;
    }

    function sendTransfer(uint256 _id) external onlyApprovers {
        if (approvals[msg.sender][_id] == false) {
            approvals[msg.sender][_id] == true;
            transfers[_id].amountOfApprovers++;
        }
        require(transfers[_id].sent == false, "Transfer has already been sent");
        if (transfers[_id].amountOfApprovers >= quorum) {
            transfers[_id].sent = true;
            address payable to = transfers[_id].to;
            uint256 amount = transfers[_id].amount;
            to.transfer(amount);
            return;
        }
    }
}
